// \u4F7F\u7528smp.wrap\u65B9\u6CD5,\u628A\u751F\u4EA7\u73AF\u5883\u914D\u7F6E\u4F20\u8FDB\u53BB,\u7531\u4E8E\u540E\u9762\u53EF\u80FD\u4F1A\u52A0\u5206\u6790\u914D\u7F6E,\u6240\u4EE5\u5148\u7559\u51FA\u5408\u5E76\u7A7A\u4F4D
module.exports = smp.wrap(
  merge(commonConfig, {
    plugins: [
      new BundleAnalyzerPlugin() // \u914D\u7F6E\u5206\u6790\u6253\u5305\u7ED3\u679C\u63D2\u4EF6
    ]
  })
);
